==English==
===Etymology===
From {{inh|en|enm|yemen}}, {{m|enm|ȝemen||to heed, pay attention, observe, keep}}, from {{inh|en|ang|ġīeman}}, from {{inh|en|gem-pro|*gaumijaną||to heed, notice, observe, keep}}. Cognate with {{cog|is|geyma}}, {{cog|no|-}} {{m|nb|gjømme}}, {{cog|sv|gömma}}, {{cog|da|gemme}}, {{cog|fo|geymi}}, {{cog|gsw|gaume}}, {{cog|got|𐌲𐌰𐌿𐌼𐌾𐌰𐌽}}. {{doublet|en|gaum}} {{gloss|"to understand, comprehend"}}, {{m|en|gorm|t=to gape, gawk}}, and {{m|en|goam|t=to recognise, pay attention}}, all from {{cog|enm|gome}}, from {{cog|non|gaum}}.
===Verb===
{{en-verb}}
# {{lb|en|obsolete}} To [[keep]], to [[observe]], to [[pay]] [[attention]].
